INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (401, "2020/07/31 12:00:00", 2, "アヤネ", 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 10046, 24, 102301, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (402, "2020/07/31 12:00:00", 2, "アヤネ", 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 10046, 24, 102301, 0.0, 2.21, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (403, "2020/07/31 12:00:00", 2, "アヤネ", 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 10046, 24, 102301, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (701, "2020/07/31 12:00:00", 1, "アサヒ", 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 10046, 24, 192201, 0.0, 1.99, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (702, "2020/07/31 12:00:00", 2, "アサヒ", 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 10046, 24, 192201, 0.0, 2.21, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (703, "2020/07/31 12:00:00", 1, "アサヒ", 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 10046, 24, 192201, 0.0, 3.33, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (801, "2020/07/31 12:00:00", 2, "部員３", 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 10046, 24, 192301, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (802, "2020/07/31 12:00:00", 2, "部員３", 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 10046, 24, 192301, 0.0, 2.68, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (803, "2020/07/31 12:00:00", 2, "部員３", 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 10046, 24, 192301, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (501, "2020/07/31 12:00:00", 1, "", 24010, "やった！", 1, 10046, 24, 192501, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (502, "2020/07/31 12:00:00", 1, "", 24011, "勝ったよ！", 1, 10046, 24, 192501, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (503, "2020/07/31 12:00:00", 1, "", 24012, "いい調子！", 1, 10046, 24, 192501, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (111, "2020/07/31 12:00:00", 2, "ミサト", 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 10046, 24, 113501, 0.0, 5.33, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (112, "2020/07/31 12:00:00", 2, "ミサト", 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 10046, 24, 113501, 0.0, 6.85, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (113, "2020/07/31 12:00:00", 2, "ミサト", 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 10046, 24, 113501, 0.0, 3.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (611, "2020/07/31 12:00:00", 2, "ダイチ", 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 10046, 24, 192401, 0.0, 6.11, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (612, "2020/07/31 12:00:00", 2, "ダイチ", 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 10046, 24, 192401, 0.0, 6.75, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (613, "2020/07/31 12:00:00", 2, "ダイチ", 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 10046, 24, 192401, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (211, "2020/07/31 12:00:00", 1, "ハツネ", 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 10046, 24, 113401, 0.0, 4.52, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (212, "2020/07/31 12:00:00", 1, "ハツネ", 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 10046, 24, 113401, 0.0, 3.89, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (213, "2020/07/31 12:00:00", 2, "ハツネ", 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 10046, 24, 113401, 0.0, 13.49, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (311, "2020/07/31 12:00:00", 2, "カヤ", 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 10046, 24, 106501, 0.0, 3.17, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (312, "2020/07/31 12:00:00", 2, "カヤ", 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 10046, 24, 106501, 0.0, 4.42, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (313, "2020/07/31 12:00:00", 1, "カヤ", 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 10046, 24, 106501, 0.0, 2.89, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (421, "2020/07/31 12:00:00", 3, "アヤネ", 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 10046, 24, 102301, 0.0, 3.71, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (721, "2020/07/31 12:00:00", 1, "アサヒ", 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 10046, 24, 192201, 0.0, 5.1, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (821, "2020/07/31 12:00:00", 3, "部員３", 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 10046, 24, 192301, 0.0, 4.34, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (521, "2020/07/31 12:00:00", 1, "", 24028, "いい勝負だったよ\nまたやろうね", 1, 10046, 24, 192501, 0.0, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (101, "2020/07/31 12:00:00", 2, "ミサト", 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 10046, 24, 113501, 0.0, 5.62, "2030/12/17 14:59:59", -360.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (102, "2020/07/31 12:00:00", 2, "ミサト", 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 10046, 24, 113501, 0.0, 9.58, "2030/12/17 14:59:59", -360.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (103, "2020/07/31 12:00:00", 2, "ミサト", 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 10046, 24, 113501, 0.0, 0.0, "2030/12/17 14:59:59", -360.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (104, "2020/07/31 12:00:00", 1, "ミサト", 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 10046, 24, 113501, 0.0, 9.13, "2030/12/17 14:59:59", -360.0);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (105, "2020/07/31 12:00:00", 2, "ミサト", 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 10046, 24, 113501, 0.0, 8.27, "2030/12/17 14:59:59", -360.0);
